-export(['__info__'/1, codepoints/1, graphemes/1,
	 length/1, next_codepoint/1, next_grapheme_size/1,
	 split_at/2, version/0]).

-spec '__info__'(attributes | compile | exports |
		 functions | macros | md5 | module |
		 native_addresses) -> atom() |
				      [{atom(), any()} |
				       {atom(), byte(), integer()}].

'__info__'(functions) ->
    [{codepoints, 1}, {graphemes, 1}, {length, 1},
     {next_codepoint, 1}, {next_grapheme_size, 1},
     {split_at, 2}, {version, 0}];
'__info__'(macros) -> [];
'__info__'(Einfo) ->
    erlang:get_module_info('Elixir.String.Unicode', Einfo).

codepoints(Ebinary@1)
    when erlang:is_binary(Ebinary@1) ->
    do_codepoints(next_codepoint(Ebinary@1)).

do_codepoints({Ec@1, Erest@1}) ->
    [Ec@1 | do_codepoints(next_codepoint(Erest@1))];
do_codepoints(nil) -> [].

do_graphemes({Esize@1, Erest@1}, Ebinary@1) ->
    [binary:part(Ebinary@1, 0, Esize@1)
     | do_graphemes(next_grapheme_size(Erest@1), Erest@1)];
do_graphemes(nil, _E) -> [].

do_length({_E, Erest@1}, Eacc@1) ->
    do_length(next_grapheme_size(Erest@1), Eacc@1 + 1);
do_length(nil, Eacc@1) -> Eacc@1.

do_split_at(Estring@1, Eacc@1, Edesired_pos@1,
	    Ecurrent_pos@1)
    when Edesired_pos@1 > Ecurrent_pos@1 ->
    case next_grapheme_size(Estring@1) of
      {Ecount@1, Erest@1} ->
	  do_split_at(Erest@1, Eacc@1 + Ecount@1, Edesired_pos@1,
		      Ecurrent_pos@1 + 1);
      nil -> {Eacc@1, nil}
    end;
do_split_at(Estring@1, Eacc@1, Edesired_pos@1,
	    Edesired_pos@1) ->
    {Eacc@1, Estring@1}.

graphemes(Ebinary@1) when erlang:is_binary(Ebinary@1) ->
    do_graphemes(next_grapheme_size(Ebinary@1), Ebinary@1).

length(Estring@1) ->
    do_length(next_grapheme_size(Estring@1), 0).

next_codepoint(<<Ecp@1/utf8, Erest@1/binary>>) ->
    {<<Ecp@1/utf8>>, Erest@1};
next_codepoint(<<Ecp@1, Erest@1/binary>>) ->
    {<<Ecp@1>>, Erest@1};
next_codepoint(<<>>) -> nil.

